import './App.css';
import {Box} from "@mui/material"
import Hero from './Components/Hero';
import Section from './Components/Section';
import HeroData from './Components/HeroData'

function App() {
  const Hero = HeroData.map(data => {
    return <Hero {...data}/>
  })
  return (
    <Box className="App">
      {Hero}
      <Section />
    </Box>
  );
}

export default App;
